Mojo Box is a brand, A sort of monthly subscription almost, where you can buy a box containing tiny cute looking products, at just around 200/- INR. You get to try out for so many brands in one box. I thought the idea of this seemed pretty cool.

Also hello? If you are on a budget and looking for a gift for a friend’s birthday then this just might be it 🤭 it’ll be random & thoughtful both, and i think that’s kinda cute. 

